import React from 'react';
import { faUsers } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function SidebarComponent() {
    return (
        <div className="flex flex-row w-72 h-screen fixed bg-gray-200 px-9 mt-16">
            <div className="flex flex-row w-fu border border-black h-16 justify-center items-center">
                <FontAwesomeIcon icon={faUsers} color='white' size="lg" />
                <h1 className="text-md font-semibold text-black">All users</h1>
            </div>
        </div>
    );
}

export default SidebarComponent;
